import React from 'react';
import GameDetails from '../components/GameDetails';
import { useParams } from 'react-router-dom';

function GamePage() {
  let { id } = useParams();

  return (
    <div>
      <GameDetails id={id} />
    </div>
  );
}

export default GamePage;
